svg.script:
var svgNS = "http://www.w3.org/2000/svg";
	function init(evt)
	{
		if(window.svgDocument == null)
		{
			svgDocument = evt.target.ownerDocument;
		}
		RotateGears('Gear-1', 0, 360, 12);
		RotateGears('Gear-2', 0, 360, 3);
		RotateGears('Gear-3', 0, -360, 6);
		RotateGears('Gear-4', 0, -360, 6);
		Rotate_Pen('Pendulum', 55, -55, 2);
	}
	function RotateGears(obj_id, deg_from, deg_to, time)
	{
  		var my_element = svgDocument.getElementById(obj_id);
  		var anim = svgDocument.createElementNS(svgNS, "animateTransform");
		var bb = my_element.getBBox();
		var cx = bb.x + bb.width/2;
		var cy = bb.y + bb.height/2;
		anim.setAttributeNS(null, "attributeName", "transform");
		anim.setAttributeNS(null, "attributeType", "XML");
		anim.setAttributeNS(null, "type", "rotate");
		anim.setAttributeNS(null, "dur", time+"s");
		anim.setAttributeNS(null, "repeatCount", "indefinite");
		anim.setAttributeNS(null, "from", deg_from+" "+cx+" "+cy);
		anim.setAttributeNS(null, "to", deg_to+" "+cx+" "+cy);
		anim.setAttributeNS(null, "fill", "freeze");
		my_element.appendChild(anim);
		anim.beginElement();
  	}
	function Rotate_Pen(obj_id, deg_from, deg_to, time)
	{
  		var my_element = svgDocument.getElementById(obj_id);
  		var ani_pen1 = svgDocument.createElementNS(svgNS, "animateTransform");
		var ani_pen2 = svgDocument.createElementNS(svgNS, "animateTransform");
		var bb = my_element.getBBox();
		var cx = bb.x + bb.width;
		var cy = bb.y;
		ani_pen1.setAttributeNS(null, "attributeName", "transform");
		ani_pen1.setAttributeNS(null, "id", "pen1");
		ani_pen1.setAttributeNS(null, "attributeType", "XML");
		ani_pen1.setAttributeNS(null, "type", "rotate");
		ani_pen1.setAttributeNS(null, "dur", time+"s");
		ani_pen1.setAttributeNS(null, "repeatCount", "1");
		ani_pen1.setAttributeNS(null, "from", deg_from+" "+cx+" "+cy);
		ani_pen1.setAttributeNS(null, "to", deg_to+" "+cx+" "+cy);
		ani_pen1.setAttributeNS(null, "fill", "freeze");
		ani_pen1.setAttributeNS(null, "begin", "pen2.end");
		my_element.appendChild(ani_pen1);
		ani_pen2.setAttributeNS(null, "attributeName", "transform");
		ani_pen2.setAttributeNS(null, "attributeType", "XML");
		ani_pen2.setAttributeNS(null, "id", "pen2");
		ani_pen2.setAttributeNS(null, "type", "rotate");
		ani_pen2.setAttributeNS(null, "dur", time+"s");
		ani_pen2.setAttributeNS(null, "repeatCount", "1");
		ani_pen2.setAttributeNS(null, "from", deg_to+" "+cx+" "+cy);
		ani_pen2.setAttributeNS(null, "to", deg_from+" "+cx+" "+cy);
		ani_pen2.setAttributeNS(null, "fill", "freeze");
		ani_pen2.setAttributeNS(null, "begin", "pen1.end");
		my_element.appendChild(ani_pen2);
		ani_pen1.beginElement();
  	}
